import React, { Component } from 'react';
import { Link } from "react-router-dom";
import Header from "../header";
import Footer from "../footer";
import { Container, Row , Col , Card, CardImg, CardText, CardBody,
  CardTitle, CardSubtitle, Button } from "reactstrap";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";





export default class learn extends Component {
   
  render(){
    return (
        <div>
           <React.Fragment>
                <Header />
                <div className="learn">
                  <h1>المنهج الدراسي</h1><br/>
                  <h5>
                  <Link to="/"> الثاني الابتدائي |</Link>
                  <Link to="/"> الثالث الابتدائي |</Link>
                  <Link to="/"> الرابع الابتدائي </Link>
                  <Link to="/"> الخامس الابتدائي </Link>
                  <Link to="/"> السادس الابتدائي </Link>
                  <Link to="/"> الاول الاعدادي </Link>
                  <Link to="/"> الثاني الاعدادي </Link>
                  <Link to="/"> الثاث الاعدادي </Link>
                  </h5>
                  <hr/>
                <Container>
                  <Row>
                    <Col md="10" sm="12" color="danger">hello</Col>
                    <Col md="2" sm="12" color="danger">hello</Col>
                  </Row>
                </Container>
                </div>

                <Footer />
          </React.Fragment>
            
        </div>
    )
  }
}
